class Prices extends React.Component {
  state = {
    currency: 'USD'
  }

  render() {
    return (
    <div>
        <h2 className={'sm:text-lg p-4 text-green-700'}> Bitcoin rate for: {this.props.bpi.bpi.USD.description}</h2>
        <ul>
          <li className={'sm:text-lgtext-md p-4 text-blue-500'}>Bitcoin Rate for {this.props.bpi.bpi.USD.code}
          {this.props.bpi.bpi.USD.symbol}{this.props.bpi.bpi.USD.rate}
          </li>
        </ul>
    </div>);
  }
}

export default Prices;
